BOEKWEITPANNENKOEKEN met GROENTEN en GEITENKAAS (2p.)

Ingrediënten:
- 200 gram boekweitmeel 
- 600 ml plantaardige melk (amandelmelk/havermelk)
- 2 á 3 eieren
- snufje zeezout
- kokosolie
- 600 gr groenten naar keuze (paprika, courgette, ui, aubergine, prei, champignons/paddenstoelen, spinazie, bietjes, etc.)
- 200 gr verse geitenkaas

Bereiding:
- Doe het boekweitmeel samen met het zout in een kom.
- Klop de eieren er een voor een door.
- Voeg beetje bij beetje de melk toe. Blijf het continue kloppen met een garde. 
- Roerbak ondertussen de kleingesneden groenten.
- Verhit wat olie in een pan. Laat de pan goed heet worden en bak de pannenkoeken. 
- Beleg de pannenkoeken met de groenten en verkruimel de geitenkaas erover. 

