En la gran mayoría de los deportes de combate🤼‍♀️🥋🥊🤺los gestos motores de las extremidades superiores ✋🏽exceden los 90° y por eso la gran importancia de la estabilidad de la cintura escapular. Esta es dada por la sinergia y participación de diferenets músculos como el Trapecio, Pectoral Menor, Dorsal Ancho, Pectoral Mayor, músculos del manguito, entre muchos otros más, y uno de suma importancia como el Serrato Anterior 🦴💀#anatomy ..
•
Hoy las investigaciones más recientes sugieren que el porcentaje de lesion de las extremidades superiores entre🧔🏽&👩🏻es más alto en población femenina y esto se debe a componentes fisiológicos🧬 (➖producción de testosterona💉) y componentes mecánicos (➖capacidad de hipertrofia 💪🏽). Entonces por esta razón cuando una atleta es sometida a cargas y a un gesto motor por arriva de los 90° su indice de lesion es mayor..
• 
